INSERT INTO products (user_id, title, description, thumbnail_photo_url, price) VALUES (3, 'Custom Mechanical Keyboard', 'Primus75 board, DSA Galactic Empire keycaps, Gazzew Boba U4T switches with a 62g actuation force, an aluminum plate in red, TX Rev 2 stabilizers, and a custom black anodized middle piece.', 'https://preview.redd.it/7z2jbmf7rtxa1.jpg?width=4080&format=pjpg&auto=webp&v=enabled&s=5432e44945c19aff600e0ea189aea2b54d8cdf0f', 700.00);
INSERT INTO products (user_id, title, description, thumbnail_photo_url, price) VALUES (3, 'Sagittarius with GMK Civilizations and Lazurite', 'The Sagittarius keyboard features U4T stems fitted into Cherry housings, with TX XL 60g springs and 3204-lubed stems. It also has a brass plate and TX stabilizers. The keycaps are GMK Civilizations with the addition of GMK Lazurite Gold High Renaissance Novelties, adding a touch of luxury to the overall aesthetic of the keyboard.', 'https://preview.redd.it/adhtdbku8hxa1.jpg?width=4032&format=pjpg&auto=webp&v=enabled&s=75917de2a1b88a968c3cf9ffc299b9bd849dc78b', 745.33);
INSERT INTO products (user_id, title, description, thumbnail_photo_url, price) VALUES (3, 'Caustic Keycult TKL', 'This is a raw aluminum no. 2 TKL from Keycult â€” received in a limited release. I sent it to Caustic Customs for anodization.It is built with HG blacks and WOB Hiragana.', 'https://preview.redd.it/xq0dreduonva1.jpg?width=4032&format=pjpg&auto=webp&v=enabled&s=5e8b670178429316c2dbdcd489d681de4de0c65b', 1200.00);
INSERT INTO products (user_id, title, description, thumbnail_photo_url, price) VALUES (3, 'TX EO-87', 'The Alpacas keyboard switches have been customized with Krytox 205g0 lubricant applied to both the housing and stem, and GPL 105 on the springs, with the addition of Deskeys switch films. The switches are also fitted with 63.5g Sprit Slow springs for a comfortable typing experience. The keyboard features a Chocobo Brass plate and Durock stabilizers, enhancing the overall durability and stability of the switches. The keycaps are GMK Minimal, giving the keyboard a sleek and minimalist look.', 'https://i.redd.it/wo083uwuc1061.jpg', 659.34);
